import Wid1 from './Wid1';
import Wid2 from './Wid2';
import './App.css';

// Clé api
const API_KEY = "1565c975df7146bfbc1c0a25568e02f1";
// Url API
const API_URL = "https://holidays.abstractapi.com/v1/?api_key=1565c975df7146bfbc1c0a25568e02f1&country=US&year=2020&month=12&day=25";

class App extends Component {
  state = [
    {
      url: "https://jsonplaceholder.typicode.com/todos/1",

    },
    {
      url: "https://jsonplaceholder.typicode.com/todos/2",

    },
    {
      url: "https://jsonplaceholder.typicode.com/todos/3",

    },
    {
      url: "https://jsonplaceholder.typicode.com/todos/4",

    },
    {
      url: "https://jsonplaceholder.typicode.com/todos/5",

    },
    {
      url: "https://jsonplaceholder.typicode.com/todos/6",

    }
  ]

  render(){
    return(
      <div className='grid-container'>
        <Wid1 url={this.state[0].url} />
        <Wid2 url={this.state[1].url} />
        <Wid2 url={this.state[2].url} />
        <Wid2 url={this.state[3].url} />
        <Wid2 url={this.state[4].url} />
        <Wid2 url={this.state[5].url} />
      </div>
    )
  }
}

export default App;
